bool ShaderDesc::IsShaderVersionSupported(ShaderVersion ver)
{
    switch(ver)
    {
        case ShaderVersion_GLSL110: return true;
        case ShaderVersion_GLSL120: return true;
        case ShaderVersion_GLSL150: return true;
        default: return false;
    }
};

